import logo from './logo.svg';

function Header() {
  return (
    <header>
      <nav className="nav-bar">
        <img src={logo} className="nav-image" />
	<ul className="nav-items">
	  <li>Pricing</li>
	  <li>About</li>
	  <li>Contact</li>
	</ul>
      </nav>
    </header>
  );
}

export default Header;
